  function addContent(strFragment) {
   svgDoc = window.svgDocument;
   if (svgDoc === undefined) {alert('Error adding content: svgDoc is undefined'); return;}
   //var root = svgDoc.rootElement;
   //if (root === undefined) {alert('Error adding content: root element not found'); return;}
   var node = parseXML(strFragment,svgDoc);
   svgDoc.appendChild(node);
  }


